import React from "react";

const ToolBar = () => {
  return (
    <div>
      <spa style={{ float: "right" }}>Home</spa>
      <span style={{ float: "right" }}>Login</span>
      <span style={{ float: "right" }}>SignIn</span>
    </div>
  );
};

export default ToolBar;
